import logo from './logo.svg';
import './App.css';
import * as pages from './pages'

function App() {
  let Component
  switch (window.location.pathname) {
    case '/':
      Component = App;
      break
      case "/game":
        Component = App;
        break
        case "/credits":
          break
  }
}

export default App;
